// Service Worker for Meet AJ Portfolio PWA
const CACHE_NAME = "meet-aj-v1.0.2";
const urlsToCache = [
  "/",
  "/index.html",
  "/assets/css/main.css",
  "/assets/css/rtl.css",
  "/assets/js/main.js",
  "/assets/js/i18n.js",
  "/assets/img/favicon.png",
  "/assets/img/apple-touch-icon.png",
  "/assets/img/logo.png",
  "/assets/img/hero-bg.jpg",
  "/assets/img/my-profile-img.jpg",
  "/assets/img/my-profile-img-2.jpg",
  "/assets/img/services.jpg",
  "/assets/img/2.jpg",
  "/assets/img/3.JPG",
  "/assets/vendor/bootstrap/css/bootstrap.min.css",
  "/assets/vendor/bootstrap-icons/bootstrap-icons.css",
  "/assets/vendor/bootstrap/js/bootstrap.bundle.min.js",
  "/assets/vendor/aos/aos.css",
  "/assets/vendor/aos/aos.js",
  "/assets/vendor/glightbox/css/glightbox.min.css",
  "/assets/vendor/glightbox/js/glightbox.min.js",
  "/assets/vendor/swiper/swiper-bundle.min.css",
  "/assets/vendor/swiper/swiper-bundle.min.js",
  "/assets/vendor/typed.js/typed.umd.js",
  "/assets/vendor/purecounter/purecounter_vanilla.js",
  "/assets/vendor/waypoints/noframework.waypoints.js",
  "/assets/vendor/imagesloaded/imagesloaded.pkgd.min.js",
  "/assets/vendor/isotope-layout/isotope.pkgd.min.js",
  "/manifest.json",
];

// Install event - cache resources
self.addEventListener("install", function (event) {
  event.waitUntil(
    caches
      .open(CACHE_NAME)
      .then(function (cache) {
        console.log("PWA Cache opened");
        return cache.addAll(urlsToCache);
      })
      .catch(function (error) {
        console.log("PWA Cache failed:", error);
      })
  );
  // Skip waiting to activate immediately
  self.skipWaiting();
});

// Fetch event - serve from cache when offline
self.addEventListener("fetch", function (event) {
  // Skip non-GET requests
  if (event.request.method !== "GET") {
    return;
  }

  // Skip cross-origin requests
  if (!event.request.url.startsWith(self.location.origin)) {
    return;
  }

  event.respondWith(
    caches
      .match(event.request)
      .then(function (response) {
        // Return cached version or fetch from network
        if (response) {
          return response;
        }

        return fetch(event.request).then(function (response) {
          // Check if we received a valid response
          if (
            !response ||
            response.status !== 200 ||
            response.type !== "basic"
          ) {
            return response;
          }

          // Clone the response
          var responseToCache = response.clone();

          caches.open(CACHE_NAME).then(function (cache) {
            cache.put(event.request, responseToCache);
          });

          return response;
        });
      })
      .catch(function () {
        // Return offline page if both cache and network fail
        if (event.request.destination === "document") {
          return caches.match("/index.html");
        }
      })
  );
});

// Activate event - clean up old caches
self.addEventListener("activate", function (event) {
  event.waitUntil(
    caches.keys().then(function (cacheNames) {
      return Promise.all(
        cacheNames.map(function (cacheName) {
          if (cacheName !== CACHE_NAME) {
            console.log("PWA Deleting old cache:", cacheName);
            return caches.delete(cacheName);
          }
        })
      );
    })
  );
  // Take control of all clients immediately
  self.clients.claim();
});

// Message event - handle messages from main thread
self.addEventListener("message", function (event) {
  if (event.data && event.data.type === "SKIP_WAITING") {
    self.skipWaiting();
  }
});

// Background sync event - handle background sync
self.addEventListener("sync", function (event) {
  if (event.tag === "background-sync") {
    event.waitUntil(
      // Perform background sync tasks
      console.log("Background sync triggered")
    );
  }
});

// Push event - handle push notifications
self.addEventListener("push", function (event) {
  if (event.data) {
    const data = event.data.json();
    const options = {
      body: data.body,
      icon: "/assets/img/logo.png",
      badge: "/assets/img/favicon.png",
      vibrate: [100, 50, 100],
      data: {
        dateOfArrival: Date.now(),
        primaryKey: 1,
      },
      actions: [
        {
          action: "explore",
          title: "View Portfolio",
          icon: "/assets/img/logo.png",
        },
        {
          action: "close",
          title: "Close",
          icon: "/assets/img/favicon.png",
        },
      ],
    };

    event.waitUntil(self.registration.showNotification(data.title, options));
  }
});

// Notification click event
self.addEventListener("notificationclick", function (event) {
  event.notification.close();

  if (event.action === "explore") {
    event.waitUntil(clients.openWindow("/"));
  }
});

// Error event - handle service worker errors
self.addEventListener("error", function (event) {
  console.error("Service Worker Error:", event.error);
});

